// SPDX-License-Identifier: MIT

pragma solidity ^0.8.21;

contract EVoting {
    struct Candidate {
        uint id;
        string firstName;
        string lastName;
        string candidateID;
        string politicalParty;
        uint voteCount;
    }

    struct Election {
        bool isActive;
        uint startTime;
        uint endTime;
        mapping(uint => Candidate) candidates;
        uint[] candidateIds;
    }

    address[] public admins; // Array to store admin addresses
    mapping(address => bool) public isAnAdmin; // Mapping to check if an address is an admin
    uint public adminCount; // Count of total admins

    mapping(uint => Election) public elections;
    uint public nextElectionId;

    // Mapping to track if a user has voted in a specific election
    mapping(address => mapping(uint => bool)) public hasVoted;

    // Constructor to initialize admin addresses
    constructor(address[] memory initialAdmins) {
        for (uint i = 0; i < initialAdmins.length; i++) {
            admins.push(initialAdmins[i]);
            isAnAdmin[initialAdmins[i]] = true;
        }
        adminCount = initialAdmins.length;
    }

    // Modifier to restrict function access to only admins
    modifier onlyAdmins() {
        require(isAnAdmin[msg.sender], "Only admins can perform this action.");
        _;
    }

    // Admin function to create an election
    function createElection(uint startTime, uint endTime) public onlyAdmins {
        Election storage election = elections[nextElectionId++];
        election.startTime = startTime;
        election.endTime = endTime;
        election.isActive = false;
    }

    // Admin function to add a candidate to an election
    function addCandidateToElection(uint electionId, string memory firstName, string memory lastName, string memory candidateID, string memory politicalParty) public onlyAdmins {
        require(elections[electionId].isActive, "Election is not active or does not exist.");
        Candidate memory newCandidate = Candidate({
            id: elections[electionId].candidateIds.length,
            firstName: firstName,
            lastName: lastName,
            candidateID: candidateID,
            politicalParty: politicalParty,
            voteCount: 0
        });
        elections[electionId].candidates[newCandidate.id] = newCandidate;
        elections[electionId].candidateIds.push(newCandidate.id);
    }

    // Admin function to start an election
    function startElection(uint electionId) public onlyAdmins {
        require(!elections[electionId].isActive, "Election is already active.");
        elections[electionId].isActive = true;
    }

    // Admin function to end an election
    function endElection(uint electionId) public onlyAdmins {
        require(elections[electionId].isActive, "Election is not active.");
        elections[electionId].isActive = false;
    }

    // Voting function using last name and secret ID for verification
    function vote(uint electionId, uint candidateId, string memory lastName, uint secretID) public {
        require(elections[electionId].isActive, "Election is not active.");
        require(keccak256(abi.encodePacked(lastName)) == keccak256(abi.encodePacked("Akinlua")), "Invalid last name.");
        require(secretID == 9068340768, "Invalid secret ID.");
        require(!hasVoted[msg.sender][electionId], "User has already voted in this election.");

        elections[electionId].candidates[candidateId].voteCount++;
        hasVoted[msg.sender][electionId] = true; // Record that the user has voted
    }

    // Function to get election results
    function getElectionResults(uint electionId) public view returns (string[] memory candidateNames, uint[] memory voteCounts) {
        require(!elections[electionId].isActive, "Election is still active.");
        uint[] memory counts = new uint[](elections[electionId].candidateIds.length);
        string[] memory names = new string[](elections[electionId].candidateIds.length);

        for (uint i = 0; i < elections[electionId].candidateIds.length; i++) {
            uint candidateId = elections[electionId].candidateIds[i];
            counts[i] = elections[electionId].candidates[candidateId].voteCount;
            names[i] = string(abi.encodePacked(elections[electionId].candidates[candidateId].firstName, " ", elections[electionId].candidates[candidateId].lastName));
        }
        return (names, counts);
    }
}
